import React, { useState} from 'react';

function Joke({data}){
	var stye={};
	if(data.question==""){
		stye={color:"red"};
		
	}
	
	
	return(
	<>
	<h1>{data.question}</h1>
	
	<h2 
		style={stye}>
	{data.punchline}
	</h2>
	
	</>
	)
	
	
	
}

export default Joke
